$1(a){return A.cE("An enthralling, yet ferocious battle between talented young musicians soon begins. Transcendence will put the skill of eager bands to the test, as their performances weave their way through different musical eras that will throw you in otherworldly dimensions.\n\nRound 1: Qualifiers\n- Each band gets 5 minutes to perform with no limit on the number of songs\n- Each band will also get 4 minutes to set up\n\nRound 2: Finals\n - The top 4 bands will have to perform two songs of contrasting eras and perform a fusion. Each band gets 6 minutes to play and 4 minutes to set up\n\nThe Qualifier round will take place on day 1, where bands will be allotted 4 minutes of setting up (tuning, setting up cables, instruments) and maximum 6 minutes of playing time with no limit on the number of songs. Note: Participants should get their own guitars/bass\n\nRules:\n- No profanity \n- Participants should get their own guitars/bass\n\n\nTeam Size: 3-7 people",B.CZ,!1,"ICSE New Auditorium","https://i.imgur.com/yx3dJZQ.png","https://forms.gle/ZmcpibSNVLHwc2e4A","Battle of the Bands")},
